import axios from 'axios'

const MODEL_API_BASE_URL = "http://localhost:8080/api/v1/";
axios.defaults.headers.common['leagueId'] = ModelService.leagueId;

class ModelService {
    static leagueId = localStorage.getItem('leagueId') || "";
z
